import styled from 'styled-components';

const AppHeader = styled.header`
  flex: 1;
  height: 100%;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Container = styled.section``;
const AppFooter = styled.footer``;

const App = () => {
  return (
    <>
      <AppHeader>Harrison Lau</AppHeader>
      <Container>

      </Container>
      <AppFooter></AppFooter>
    </>

  )
}

export default App;
